const int Board::rowDirection[8]{ -1, -1, 0, 1, 1, 1, 0, -1 };
const int Board::colDirection[8]{ 0, 1, 1, 1, 0, -1, -1, -1 };

py::tuple Board::isTerminal()
{
	py::tuple amazons[4];
	if (turn == S::BLACK)
	{
		amazons = blackAmazons;
	}
	else
	{
		amazons = whiteAmazons;
	}
	for (auto amazon : amazons)
	{
		int row = amazon[0];
		int col = amazon[1];
		for (int i = 0; i < 8; i++)
		{
			int newRow = row + Board::rowDirection[i];
			int newCol = col + Board::colDirection[i];
			if (newRow < 0 || newRow > 9 || newCol < 0 || newCol > 9)
			{
				continue;
			}
			if (board[newRow][newCol] == S::EMPTY)
			{
				return py::make_tuple(false, py::none());
			}
		}
	}
	S winner;
	if (turn == S::BLACK)
	{
		winner = S::WHITE;
	}
	else
	{
		winner = S::BLACK;
	}
	return py::make_tuple(true, winner);
}

Board::Board()
{
	for (int i = 0; i < 10; i++)
	{
		for (int j = 0; j < 10; j++)
		{
			board[i][j] = S::EMPTY;
		}
	}
	board[0][3] = S::BLACK;
	blackAmazons[0] = py::make_tuple(0, 3);
	board[0][6] = S::BLACK;
	blackAmazons[1] = py::make_tuple(0, 6);
	board[3][0] = S::BLACK;
	blackAmazons[2] = py::make_tuple(3, 0);
	board[3][9] = S::BLACK;
	blackAmazons[3] = py::make_tuple(3, 9);
	board[6][0] = S::WHITE;
	whiteAmazons[0] = py::make_tuple(6, 0);
	board[6][9] = S::WHITE;
	whiteAmazons[1] = py::make_tuple(6, 9);
	board[9][3] = S::WHITE;
	whiteAmazons[2] = py::make_tuple(9, 3);
	board[9][6] = S::WHITE;
	whiteAmazons[3] = py::make_tuple(9, 6);

	turn = S::WHITE;
}
Board::Board(const Board& aBoard)
{
	for (int i = 0; i < 10; i++)
	{
		for (int j = 0; j < 10; j++)
		{
			board[i][j] = aBoard.board[i][j];
		}
	}
	for (int i = 0; i < 4; i++)
	{
		blackAmazons[i] = aBoard.blackAmazons[i];
		whiteAmazons[i] = aBoard.whiteAmazons[i];
	}
	turn = aBoard.turn;
}

